import React, { useEffect, useState } from "react";

export default function CompanyHome({ userData }) {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:5000/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userData");
        setData(data.data);

      });
  }, []);

  return (
    <div>
      <h5>Welcome Company</h5>
      <table style={{ width: 500 }}>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>User Type</th>
          <th>Delete</th>
        </tr>
        {data.map((i) => {
          return (
            <tr key={i._id}>
              <td>{i.fname}</td>
              <td>{i.email}</td>
              <td>{i.userType}</td>
              <td></td>
            </tr>
          );
        })}
      </table>
    </div>
  );
}
